import {Outlet, Link} from "react-router-dom";

export default function Navbar() {
    //state

    //comportement

    //affichage
    return (
        <>
            <nav className="navlink">
                <ul>
                    <li>
                        <Link to="/" className="navLi">Home</Link>
                    </li>
                    <li>
                        <Link to="/about" className="navLi">About</Link>
                    </li>
                    <li>
                        <Link to="/about" className="navLi">Market</Link>
                    </li>
                </ul>
            </nav>
            <Outlet/>
        </>
    )
}
